import React, { useEffect } from 'react';
import Header from "../Components/Header";
import Footer from "../Components/Footer";

const Administrative = (props) => {

    const population = [];
    const homes = [];
    const yoruba = [];
    const hausa = [];
    const igbo = [];

    useEffect(() => {
        const navList = document.querySelectorAll("li");
        navList.forEach(list => {
            if (list.classList.contains("active")) {
                list.classList.remove("active");
            }
        })
        navList[2].classList.add("active");

        props.censusData.map(data => {
          population.push(data.population);
          homes.push(data.homes);
          yoruba.push(data.yoruba);
          hausa.push(data.hausa);
          return igbo.push(data.igbo);
        })
    })
    return (
        <>
        <div className="container-xl container-fluid">
        <Header/>
            <div className="admin">
              <h1>Admin Dashboard</h1>
              <table>
              <colgroup span="6"></colgroup>
                <thead>
                    <tr>
                      <th rowSpan="2">States</th>
                      <th rowSpan="2">Population</th>
                      <th rowSpan="2">Homes</th>
                      <th colSpan="3">Languages</th>
                      </tr>
                      <tr>
                        <th>Hausa</th>
                          <th>Igbo</th>
                          <th>Yoruba</th>
                    </tr>
                </thead>
                <tbody>
                    {props.censusData.map(data => {
                        return <tr key={Math.random()}>
                            <td>{data.state}</td>
                            <td>{data.population}</td>
                            <td>{data.homes}</td>
                            <td>{data.hausa}</td>
                            <td>{data.igbo}</td>
                            <td>{data.yoruba}</td>
                        </tr>
                    })}
                </tbody>
                <tfoot>
                    <tr>
                        <th>Total</th>
                        <th>{population.reduce((a,b) => a+b)}</th>
                        <th>{homes.reduce((a,b) => a+b)}</th>
                        <th>{hausa.reduce((a,b) => a+b)}</th>
                        <th>{igbo.reduce((a,b) => a+b)}</th>
                        <th>{yoruba.reduce((a,b) => a+b)}</th>
                    </tr>
                </tfoot>
              </table>
            </div>
        <Footer />
        </div>
        </>
    )
}
export default Administrative;
